,"POLYGON",
Polygon[GeoPosition[ToExpression[Reverse[StringSplit[#, " "]]],model]& /@ StringCases[wkt, NumberString ~~ " " ~~ NumberString]]

,"MULTIPOLYGON",
Polygon[GeoPosition[ToExpression[StringCases[StringSplit[wkt, "),("], lo:NumberString~~ Whitespace~~la:NumberString ->  {la, lo}]],model]]

,_,
Echo["Can't do that yet. Just points and polygons."]
]
];


processProperty[Alternatives@@Normal@allproperties[Select[#[["Data type"]]=="globe-coordinate"&],"ID"],value_]:=
If[StringStartsQ[value,"<"],
parseWKT[StringRiffle[Rest@StringSplit[value]],resolveEntity[First@StringCases[value,"Q"~~NumberString]]],
parseWKT[value]]


processProperty[Alternatives@@Normal@allproperties[Select[#[["Data type"]]=="geo-shape"&],"ID"],value_]:=
  Cases[ImportString[ExportString[Import[StringReplace[value,"+"->"_"],"RawJSON"]["data"],"JSON"],{"GeoJSON","Data"}],_Polygon,\[Infinity]]


processProperty[Alternatives@@Normal@allproperties[Select[#[["Data type"]]=="time"&],"ID"],value_]:=If[StringStartsQ[ToLowerCase@value,"t"],Missing["WrongFormat"],DateObject[value]]


processProperty[Alternatives@@Normal@allproperties[Select[#[["Data type"]]=="url"&],"ID"],value_]:=URL[value]


processProperty[Alternatives@@Normal@allproperties[Select[#[["Data type"]]=="quantity"&],"ID"],value_]:=Quantity[value]


processProperty[Alternatives@@Normal@allproperties[Select[#[["Data type"]]=="commonsMedia"&&(StringContainsQ[#description,"image"]||StringContainsQ[#description,"graphic"]||StringContainsQ[#description,"picture"]||StringContainsQ[#description,"map"]||StringContainsQ[#description,"panorama"])&],"ID"],value_]:=If[StringContainsQ[value,"svg"],URL[value],Thumbnail[value]]


processProperty[Alternatives@@Normal@allproperties[Select[#[["Data type"]]=="commonsMedia"&&(StringContainsQ[#description,"audio"]||StringContainsQ[#description,"sound"])&],"ID"],value_]:=Audio[value]


processProperty[Alternatives@@{"P368","P996","P2919","P3030","P4896","P5555","P5775"},value_]:=Import[value]


processProperty["P10",value_]:=URL[value]


processProperty[Alternatives@@allproperties[Select[#[["Data type"]]=="tabular-data"&],"ID"],value_]:=Import[value]


processProperty[prop_,value_String?(StringMatchQ[#,"Entity["~~__]&)]:=ToExpression@value


processProperty[prop_,value_]:=value


WikidataDataset[entity_]:=wikidataQuery[propertyQuery[entity],1000,"CSV"][GroupBy["entity"],All,<|#propLabel->processProperty["P"<>ToString@#propNumber,#val]|>&][All,Merge[Identity]][All,All,If[Length@#==1,#[[1]],#]&]


defaultFunction[prop_]:=Module[{value=DeleteMissing[wikidataQuery[specificPropertyQuery[CanonicalName@#,Last@prop],1,"CSV"]][First,"valueLabel"]},
  If[MissingQ[value], value, processProperty[Last@prop,value]]]&
defaultFunctionCached[propLabel_, propId_, ent_]:=defaultFunctionCached[propLabel, propId, ent]=defaultFunction[{propLabel, propId}][ent]


renameProp[propLabel_, propId_]:=Module[{label=Switch[propId,
"P3896","Polygon",
"P625", "Position",
"P21","Gender",
"P19","BirthPlace",
"P20","DeathPlace",
"P569","BirthDate",
"P570","DeathDate",
_, StringReplace[Capitalize[propLabel, "AllWords"], WhitespaceCharacter -> ""]
]},
label -> <|
    "DefaultFunction" -> (defaultFunctionCached[propLabel,propId,#] &),
    "Label" -> ToLowerCase[propLabel]
    |>]


WikidataEntityStoreSparql[name_,fragment_]:=Module[{ids=<|First@#-><|"Label"->Last@#|>&/@entityLabelListSparql[fragment]|>},
  EntityStore[name-><|
    "Entities"->ids,
    "Label"->"name",
    "Properties"->AssociationMap[renameProp[#[[1]], #[[2]]]&,AssociationMap[Reverse,wikidataPropertyLabelList[Keys@ids]]]
  |>]]


WikidataEntityStore[entityClass_?(StringContainsQ[DigitCharacter]),pred_:"P31"]:=Module[{
ids=<|First@Capitalize@#-><|"Label"->Last@#|>&/@ entityLabelList[iriToId[entityClass],iriToId[pred],1000]|>,
typeLabel=StringReplace[Capitalize[wikidataQuery[labelQuery[iriToId[entityClass]],1,"CSV"][First,"valueLabel"],"AllWords"],WhitespaceCharacter->""]},
  EntityStore[typeLabel-><|
    "Entities"->ids,
    "Label"->"name",
    "Properties"->AssociationMap[transform,AssociationMap[Reverse,wikidataPropertyLabelList[Keys@ids]]]
  |>]]


WikidataEntityStore[name_,entityClass_,pred_:"P31"]:=Module[{
  ids=<|First@#-><|"Label"->Last@#|>&/@entityLabelList[iriToId[entityClass],iriToId[pred],1000]|>},
  EntityStore[name-><|
    "Entities"->ids,
    "Label"->"name",
    "Properties"->AssociationMap[transform,AssociationMap[Reverse,wikidataPropertyLabelList[Keys@ids]]]
  |>]]
